    "characteristics-of-california-least-tern-nesting-sites-associated-with-breeding-success-or",nt"isopen":
    false,nt"url": null,nt"notes": "The Naval Air Station, Alameda, is being
    closed under the requirements of the Defense Base Realignment and Closure Act of
    1990. The purpose of this report is to assist the Navy in meeting its requirements
    under the Endangered Species Act regarding the endangered California least tern
    (Sterna antillarum browni)  nesting site at the HAS Alameda. This report consists
    of a review of California least tern breeding biology, a discussion of factors that
    negatively affect tern reproductive success across the state (and therefore management
    problems associated with tern nesting sites), and an evaluation of site characteristics
    and  management policies that reduce the impacts of sources of tern disturbance
    and mortality.",nt"license_title": "License Not Specified",nt"extras":
